function onMenuKeyDown(){"use strict";$.mobile.changePage("#menuOptions",{transition:"slideup",role:"dialog"})}function applyTheme(){"use strict";var i=0,newPage="",theme="",themeOptions=document.changeThemeForm.themeChoice;for(i=0;i<themeOptions.length;i++){if(themeOptions[i].checked){theme=themeOptions[i].value}}if(theme!=="a"){newPage="index"+theme+".html"}else{newPage="index.html"}window.location.href=newPage}